def get_timing_analysis(stats):
    # Filter out the terminator row (999.0)
    valid_rows = [row for row in stats if row[0] != 999.0]
    
    # Calculate timing differences in microseconds
    send_time = [round((row[1] - row[0]) * 1_000_000, 3) for row in valid_rows]      # t2 - t1
    process_time = [round((row[2] - row[1]) * 1_000_000, 3) for row in valid_rows]   # t3 - t2
    response_time = [round((row[3] - row[2]) * 1_000_000, 3) for row in valid_rows]  # t4 - t3
    
    print("Send time (t2 - t1):")
    print(send_time, "usec")
    print("Process time (t3 - t2):")
    print(process_time, "usec")
    print("Response time (t4 - t3):")
    print(response_time, "usec")
    print()

for i, ex in enumerate([ex_1, ex_2, ex_3], start=1):
    print(f"Example {i}:")
    get_timing_analysis(ex)